function encode(code) {
  const binary = code.split('').map(c => c
    .charCodeAt(0)
    .toString(2)
    .padStart(7, 0)
  ).join('');

  const bigInt = BigInt('0b' + binary);
  const bigString = bigInt.toString();
  return bigString;
}